(1, 'Ostatnia Okazja!', 'Witajcie!!\r\nUżyj skrótu CTRL+F aby wyszukać..................:)   .    .             ...      ..\r\n\r\nOstatnia Okazja - to :\r\nOkazja bo wyprzedajemy tanio !! \r\nOstatnia bo po sprzedaży, już nie będzie nic:)!!!!\r\nKatalog ten powstał by ułatwić Wasze zakupy a moją sprzedaż na Allegro ! ---\r\n\r\nBędzie uzupełniany, więc warto śledzić ---nowe--- pozycje a wszystko sukcesywnie będzie wystawiane na Allegro, użytkownik: OstatniaOkazja .\r\n UWAGA będą wystawiane aukcje z licytacją, również od bardzo niskich kwot!!----!\r\n\r\n Nie przegap. Będą najlepsze oferty, może i na świecie :)!!\r\n\r\nWystawione rzeczy są przeznaczone do szybkiej sprzedaży ,są od zaraz dostępne a cena może  być negocjowana przed wystawieniem  na aukcji ! \r\n(Po zakończeniu aukcji  nie ma negocjacji !) Jeśli nie wystawiono ceny - to zaproponuj swoją  ! Powodzenia !! Nie Odpowiadamy na lakoniczne pytania więc jeśli nie otrzymałeś odpowiedzi to znaczy że zbyt mało podałeś informacji. Istnieje możliwość dostawy towaru, bardzo tanio a nawet darmo ( przy okazji w pewne rejony ),po wcześniejszej zapłacie. Mogę wysłać pocztą po doliczeniu kosztów. Koszt przesyłki  kurierskiej ok. 20zł ale może być i dużo więcej - więc jak masz wątpliwości to pisz abcreative@interia.pl \r\nWiększość rzeczy przeznaczona dla umiejących coś zrobić:) .  Nam zależy na Twoi ZAdowoleniu!:) bo wrócisz na następne zakupy. Cena ma mniejsze znaczenie ale i tu są granice do których możemy negocjować!:) Im bardziej konkretny kupiec tym.... lepsze ceny :) , ponieważ jest kilka tysięcy produktów, więc określ się..:)) .\r\n\r\nSerdecznie Zapraszamy \r\nOstatnia Okazja', 1);
