(1, 'Sejf Kasjerski Cerber Szuflada z wrzutnią. Bardzo Solidny!', 'Wyjątkowa okazja !!!\r\n\r\nSejf  Kasjerski . Szuflada z wrzutnią, polskiej marki Techmark Cerber  (cena kilka lat temu ok. 3200zł‚ ). Dlatego moje 2199 zł‚ to atrakcyjna oferta ! Jednak do Negocjacji:)\r\n\r\nJest w stanie idealnym (bardzo mało używany i jest po przeglądzie , malowaniu ).\r\n\r\nBył na wyposażeniu Banku.\r\n\r\n\r\nPodstawowym typem zamknięcia są 2 atestowane zamek jedno kluczowy (jeden klucz dwu zabierakowy na wyposażeniu ). Sejf jest oryginalnie przystosowany do zamka elektronicznego lub szyfrowego.\r\n\r\n\r\n\r\nSolidne i grube ścianki : 7 cm w wykonaniu dwu płaszczowym ( wewnątrz zastosowano specjalny materiał ogniotrwały).\r\n\r\n\r\nBardzo solidne drzwi sejfu blokowane są przez 4 masywne rygle wysuwane w trzech kierunkach z Mocnymi zawiasami wewnętrznymi- krytymi ! Tworzy to urządzenie ,, nie do ruszenia,,\r\n\r\n\r\nDodatkowo na dnie są otwory umożliwiające montaż do podłoża .\r\n\r\nSejf po produkcji otrzymał klasę bezpieczeństwa I, z certyfikatem IMP( jest tabliczka z wszelkimi danymi )!\r\n\r\nZdjęcie tabliczki może być od innego sejfu ,ponieważ już sprzedawałem i mam jeszcze identyczne sejfy. Numery seryjne są wybijane w 3 miejscach !\r\nPokryty jest nie ,,rzucającą się w oczy,, szarą farbą proszkową. Może być jako mebel,szafka w biurze , domu . Można przechowywać duże kwoty pieniędzy,kosztowności ale i dokumenty , nośniki danych , pamiątki, chemię ,farmaceutyki, narzędzia ,komputer itp. ponieważ  nie jest to ,,chińszczyzna,, a solidna produkcja dla celżw bankowych.\r\n\r\n\r\nWymiary zewnętrzne : wys. 70 cm , szer. 52 cm , gł. 46 cm .\r\n\r\n\r\nWaga ok. 100kg w związku z tym mile widziany odbiżr osobisty, jednakże istnieje możliwość\r\nodpłatnej wysyłki ,, przy okazji,,, .\r\n\r\nWYPRZEDAŻ.\r\nZaproponuj swoją cenę ,jeżeli interesująca to odpowiem.Interesuje Cię więcej sejfów po uzgodnieniu ceny mogę wystawić na Allegro. Takiej okazji długo nie będzie !\r\n\r\nNa działanie sejfu mogę odpłatnie udzielić gwarancji .\r\n\r\n', '2199', '559f4cc5688a7', 1),
