(2, 'Sejf Bankowy, Posejdon, Ogniodporny, Kasa pancerna', 'Wyjątkowa okazja ! Sejf gabinetowy polskiej marki Posejdon (cena kilka lat temu ok. 2900zł ). Dlatego moje 1770 zł to atrakcyjna oferta !\r\n\r\nJest w stanie idealnym (bardzo mało używany i jest po przeglądzie , malowaniu . Zdjęcia wykonano przed odnowieniem ).\r\n\r\nBył na wyposażeniu Banku.\r\n\r\n\r\nPodstawowym typem zamknięcia jest atestowany zamek jedno kluczowy (jeden klucz dwu zabierakowy na wyposażeniu ). Sejf jest oryginalnie przystosowany do zamka elektronicznego lub szyfrowego.\r\n\r\n\r\nMa 2 przestawne bądź całkowicie wyjmowane półki ( pozostaje wtedy jedna duża komora ) .\r\n\r\n\r\nGrubość ścianek 7 cm w wykonaniu dwu płaszczowym ( wewnątrz zastosowano specjalny materiał ogniotrwały).\r\n\r\n\r\nDrzwi sejfu blokowane są przez 4 masywne rygle wysuwane w trzech kierunkach z zawiasami wewnętrznymi- krytymi ! Tworzy to urządzenie ,, nie do ruszenia,,\r\n\r\n\r\nDodatkowo na dnie są otwory umożliwiające montaż do podłoża .\r\n\r\nSejf po produkcji otrzymał klasę bezpieczeństwa I, z certyfikatem IMP( jest tabliczka z wszelkimi danymi )!\r\n\r\nZdjęcie tabliczki może być od innego sejfu ,ponieważ już sprzedawałem i mam jeszcze identyczne sejfy. Numery seryjne są wybijane w 3 miejscach !\r\nPokryty jest nie ,,rzucającą się w oczy,, szarą farbą proszkową. Może być jako mebel,szafka w biurze , domu . Można przechowywać duże kwoty pieniędzy,kosztowności ale i dokumenty , nośniki danych , pamiątki, chemię ,farmaceutyki, narzędzia ,komputer itp. ponieważ rżwnież jest ognioodporny i nie jest to ,,chińszczyzna,, a solidna produkcja dla celów bankowych.\r\n\r\n\r\nWymiary zewnętrzne : wys. 70 cm , szer. 52 cm , gł. 46 cm .\r\n\r\nWaga w przybliżeniu ok. 120kg w związku z tym odbiór osobisty, jednakże istnieje możliwość odpłatnej wysyłki ,, przy okazji,,, lub kurierem .\r\n\r\nZaproponuj swoją cenę ,jeżeli interesująca to odpowiem.\r\n\r\nNa działanie sejfu udzielam 365 dniowej gwarancji . ', '', '559f50515