(5, 'Sejf Metalkas kasa pancerna, Mocny ! Okazja !! Bankowy !! Wyprzedaż!!!!!!!', 'Cena i aukcja dotyczy sejfu, stan idealny, sprawny 100%  . Uważam że cena jest niska . O solidności tego typu sejfów mogę napisać w mailu.Ceny do negocjacji przy większych ilościach ! Wystawię na Allegro . Rzeczy znajdują się w różnych lokalizacjach przed kupnem zapytaj gdzie odbiór. Po uzgodnieniu istnieje możliwość transportu a preferowany bezpłatny odbiór (wcześniej należy to uzgodnić ). Nie ma możliwości zwrotu,gwarancji,rękojmi za to jest cena obniżona. Zadając pytanie precyzyjne (opisz co i do czego potrzebujesz), oszczędzasz swój i mój czas .\r\n\r\n\r\nDokładny opis:\r\n\r\nPodstawowym typem zamknięcia jest atestowany zamek jedno kluczowy ( klucz dwu zabierakowy na wyposażeniu ). Sejf jest oryginalnie przystosowany do zamka elektronicznego lub szyfrowego. Ma inne  zabezpieczenia przed włamaniem.\r\n\r\n\r\n Ma 2 przestawne bądż całkowicie wyjmowane półki ( pozostaje wtedy jedna duża komora ) Duże zdjęcia dokładnie to pokazują .\r\n\r\n\r\nGrube ścianki w wykonaniu  dwu płaszczowym .\r\n\r\n\r\n Drzwi sejfu blokowane są przez 4 masywne rygle ( średnicy 25mm specjalna stal ) z zawiasami wewnętrznymi- krytymi ! Tworzy to urządzenie ,, nie do ruszenia,,\r\n\r\n\r\n Dodatkowo  na dnie są otwory umożliwiające montaż do podłoża .\r\n \r\nSejf po produkcji otrzymał  klasę bezpieczeństwa I, z certyfikatem IMP( jest tabliczka z wszelkimi danymi ).\r\n Pokryty jest nie ,,rzucającą się w oczy,,  szarą farbą proszkową. Może być jako mebel,szafka w biurze , domu . Można przechowywać duże kwoty pieniędzy,kosztowności ale i dokumenty , nośniki danych , pamiątki, chemię ,farmaceutyki,  narzędzia ,komputer itp.  ponieważ rżwnież jest ognioodporny .\r\n\r\n\r\nSpecjalne wykonanie dla bankżw ,ciężko nawet celowo go uszkodzić.\r\n Wymiary zewnętrzne : wys. 70 cm , szer. 52 cm , gł. 50cm .\r\n\r\n Na moich aukcjach inne sejfy rżwnież wrzutowe i multisejfy.\r\n\r\n Masz pytania - chętnie odpowiem e-mailem.\r\n\r\n\r\nKupujesz na moich aukcjach , oznacza to że zapoznałeś się i akceptujesz warunki na ,,Strona o mnie ,, .\r\n\r\n\r\nDziękuję i zapraszam', '2399', '559f743334158', 1),
