(24, 'Obręcz,Dekiel, Obejma , Pierścień, Pokrywa Beczki', 'Pasują do beczek 30,60,110,130 i 180 litrów -To są TYPOWE beczki Najczęściej spotykane!! Oraz do wiaderek 30l. Cena uzależniona od stanu, wielkości i typu', '', '55b7c8771fb42', 1),
