(29, 'Stara skrzynia Góralska 2szt', 'Do renowacji i pomalowania ', '', '55b935f8eb1aa', 1),
(30, 'Płyta Węglik krzemu,Ceramika Ognioodporna, Ogniotrwała !', 'Bardzo wysoka odporność termiczna . Duża ilość,więcej to taniej. Grubość 7 mm  w najgrubszym miejscu.\r\nTwardość 9 - 10 - Prawie jak diament. Idealna do pieca do wypalania ceramiki czy topienia metali itp.\r\nJest wrażliwy na działanie zasad a nie reaguje z kwasami\r\nPowierzchniowo utleniania się w temperaturze powyżej 1400 °C i  tworzy się  warstwa ochronna SiO2 , po czym zachowuje odporność do 1850oC\r\nB.wysoka przewodność cieplna i elektryczna.', '65', '55b936e53d1af', 1),
(31, 'Cegła ognioodporna,b.wysoka odporność temperaturowa, szamot nie akumulujący ciepła', 'Bardzo lekka nowoczesna i energooszczędna.  Nie to co zwykła szamotka, która nagrzewa się baardzo dłuugo np.  2godz. do1000oC . Moje cegły w zależności od rodzaju ( są 3 typy ) nie nagrzewają się ( cała energia idzie w nagrzanie komory i wsadu więc może to być np.1min. Oczywiście to jest tylko przykład bo nie znam parametrów pieca i wsadu. Może inny przykład . Jeden dom z betonu , drugi z ciepłych pustaków , trzeci z  bloczków ( pustaków styropianowych ) . Wychłodzony do 0 oC ( ja b. często mam i mniej ) , który szybciej ogrzejemy? Ze styropianu ciepło poczujesz po kilkunastu  minutach .  W innych domach po kilkunastu godzinach będzie dalej ziąb szedł ze ścian - i dalej trzeba grzać . Albo na szybko , przyłóż rękę do styropianu i do betonu.\r\nPonadto szamot przewodzi ciepło- nagrzewa się cała ( duże straty ). Po krótkim czasie cegła będzie gorąca cała - również po przeciwnej stronie niż komora. W moich cegłach , druga strona będzie zimna !', '', '55b93836252f0', 1),
(32, 'Cegła  szamot  akumulujący ciepło z otworami', 'Ciężka , ognioodporna,b.wysoka odporność temperaturowa,', '', '55b9393bc04f5', 1),
(33, 'Cegła ognioodporna , wysoka odporność temperaturowa, szamot nie akumulujący ciepła', 'Cegły z demontażu mogą być łatwo docięte na wymiar i oszlifowane. Bardzo lekka nowoczesna i energooszczędna.  Nie to co zwykła szamotka, która nagrzewa się baardzo dłuugo np.  2godz. do1000oC . Moje cegły w zależności od rodzaju ( są 3 typy ) nie nagrzewają się ( cała energia idzie w nagrzanie komory i wsadu więc może to być np.1min. Oczywiście to jest tylko przykład bo nie znam parametrów pieca i wsadu. Może inny przykład . Jeden dom z betonu , drugi z ciepłych pustaków , trzeci z  bloczków ( pustaków styropianowych ) . Wychłodzony do 0 oC ( ja b. często mam i mniej ) , który szybciej ogrzejemy? Ze styropianu ciepło poczujesz po kilkunastu  minutach .  W innych domach po kilkunastu godzinach będzie dalej ziąb szedł ze ścian - i dalej trzeba grzać . Albo na szybko , przyłóż rękę do styropianu i do betonu.\r\nPonadto szamot przewodzi ciepło- nagrzewa się cała ( duże straty ). Po krótkim czasie cegła będzie gorąca cała - również po przeciwnej stronie niż komora. W moich cegłach , druga strona będzie zimna !', '', '55b9398f177f7', 1),
(34, 'Zaprawa ogniotrwała Klej wysokotemperaturowy  szybkosnący', 'Wysoka wydajność ,bardzo mocny, błyskawicznie twardnieje , konsystencja śmietany. \r\nInstrukcja stosowania zostanie dołączona do zapotrzebowania - określ do czego a być użyte.. Opakowanie 20kg lub dowolnie mniejsze nawet 100gr.\r\nCena w zależności od ilości. \r\nIdealny do urządzeń budowanych z bardzo lekkich nowoczesnych materiałów ognioodpornych.', '', '55b93b53bb4d7', 1),
(35, 'Piasek kolorowy ,Tynk żywiczny Mozaika Podłoga może być jako ścierniwo', 'Duże ilości ! Cena ( Maksymalna 3zł /kg)do negocjacji w zależności od koloru,czystości i ilości . Bardzo tanie materiały . Niektóre partie mogą wymagać przepłukania - ale to w zależności od zastosowania . Jest różnego  koloru,czystości i ilości.\r\nPytaj o dostępny kolor ew. wyślę dowolny.', '', '55b93cb85b9c8', 1),
(36, 'Drabina sznurowa , drewniana , zwijana , długa', '38 toczonych z twardego drewna, szczebli ,12mb długości - gratis 4-5 szczebli . Mogę  dać gratis inne sznury .', '', '55b93e4dad292', 1),
