(128, 'Czujka sejsmiczna Siemens GM 730 ', 'CZUJKA PRZEZNACZONA DO TAKICH OBIEKTÓW JAK SKARBCE I SEJFY, GDYŻ POZWALA NA ODRÓŻNIENIE NATURALNYCH DRGAŃ MECHANICZNYCH I WSTRZĄSÓW OD DRGAŃ WYWOŁANYCH PRÓBĄ WŁAMANIA  i  NAPADU ', '1870 ', '55bbd58dadb57', 1),
(129, 'Sejfy Kosmetal z Wrzutnią szufladową lub Bębnową', 'Opis Konsmetalu :\r\n\r\nSejfy kasjerskie SL 67+ kl. S2 (rysunek) służą do przekazywania i przechowywania wartości pieniężnych, dokumentów, czeków, kart kredytowych bez potrzeby otwierania sejfu przy wrzucie.\r\nSejfy SL+ posiadają Certyfikaty Instytutu Mechaniki Precyzyjnej na klasę S2 do przechowywania wartości pod nadzorem.\r\nSejf SL 67+ zbudowany jest z szuflady wrzutowej i komory głównej (depozytowej). Szuflada składa się z dwóch części, pierwsza służy do przechowywania bilonu i banknotów, druga posiada ruchome dno i wykorzystywana jest jako wrzutnia. Nadmiar gotówki wrzucony do drugiego przedziału szuflady spada na dno sejfu do komory głównej (depozytowej), skąd po otwarciu drzwi można go wyjąć lub przełożyć na stałą półkę.\r\nSejf SLK 67+ zbudowany jest z szuflady I wrzutowej, szuflady II i komory głównej (depozytowej). Szuflada I wrzutowa składa się z dwóch części, pierwsza służy do przechowywania bilonu i banknotów, druga posiada ruchome dno i wykorzystywana jest jako wrzutnia. Do przechowywania posortowanej gotówki i bilonu służy szuflada II. Nadmiar gotówki wrzucony do drugiego przedziału szuflady I wrzutowej spada na dno sejfu do komory głównej (depozytowej), skąd po otwarciu drzwi można go wyjąć, przełożyć na półkę w  komorze głównej lub włożyć do szuflady II.\r\n\r\n \r\nRys. Sejf  kasjerski SL 67+\r\n\r\n1. Wymiary sejfu kasjerskiego SL 67+ i SLK 67+ 2.\r\nMODEL	Wymiary* [mm]	Wysuw szuflady [mm]\r\n	W	S	G	\r\nSL 67+	670	500	550	-\r\nSzuflada	122	437	500	370\r\nKomora główna	456	390	429	\r\n\r\nParametry techniczne sejfu SL+\r\n?	korpus to wielowarstwowe ściany o wysokiej odporności na sforsowanie\r\n?	drzwi wielopłaszczowe z wkładem osłaniającym zamek główny\r\n?	pancerz drzwi\r\n?	korpus zewnętrzny - blacha\r\n?	zawiasowanie wewnętrzne, kąt otwarcia drzwi 800-1000\r\n?	szyld z blachy ozdobnej (kwasoodpornej)\r\n\r\nWyposażenie standardowe\r\n•	zamek kluczowy  kl. A (szuflady wyposażone w zamek kluczowy  kl. A)\r\n•	dwa klucze do zamontowanego zamka kluczowego\r\n•	półki (ich liczba zależna jest od wielkości wyrobu) - sejfy wyposażone w półki z  płynną regulacją wysokości mocowania\r\n•	kotwa do mocowania do podłoża\r\n•	szuflady wyposażone w fachownicę (plastikową wkładkę do przechowywania bilonu)\r\n\r\nWyposażenie dodatkowe\r\n•	wyprowadzenie instalacji alarmowej\r\n•	zamek zatrzaskowy w szufladzie\r\n•	czujniki alarmowe: wstrząsu, położenia drzwi i rygli\r\n•	dodatkowa szuflada w modelu SLK 67+\r\n\r\nRyglowanie\r\n•	4 rygle ruchome w poziomie, 2 rygle ruchome w pionie\r\n\r\nStosowane zamki (dotyczy komory głównej)\r\n•	kluczowy kl. A\r\n•	szyfrowy mechaniczny kl. A\r\n•	elektroniczny kl. A\r\n\r\nMożliwe kombinacje:\r\n•	kluczowy + kluczowy\r\n•	kluczowy + szyfrowy\r\n•	kluczowy + elektroniczny\r\n\r\nKotwienie\r\n?	1 otwór w dnie sejfu, kotwa M16 x 250 mm (śruba rozporowa osadzona w podłożu na głębokość min 130 mm w betonie B15)\r\n', '', '55bcadffe011d', 0),
