(135, 'Czujka Alarmtech Cd-400R', 'CZUJKA PRZEZNACZONA DO TAKICH OBIEKTÓW JAK SKARBCE I SEJFY, GDYŻ POZWALA NA ODRÓŻNIENIE NATURALNYCH DRGAŃ MECHANICZNYCH I WSTRZĄSÓW OD DRGAŃ WYWOŁANYCH PRÓBĄ WŁAMANIA  i  NAPADU \r\nPosiadam inny osprzęt-pytaj!\r\nDetektory wstrząsowe - seria CD\r\n\r\nDetektory wstrząsowe rejestrują wibracje z określoną amplitudą drgań i krótkim czasem występowania. Przeznaczone do zabezpieczania ścian, drzwi i okien w różnego typu obiektach. Sygnalizują próby sforsowania zabezpieczanych powierzchni za pomocą tępych narzędzi, stosowanych z użyciem dużej siły. Ich działanie, oparte na cyfrowym przetwarzaniu zarejestrowanych zdarzeń za pomocą mikrokontrolera o zaawansowanym algorytmie obróbki sygnału, zapewnia niezawodność detekcji i odporność na zakłócenia z zewnątrz. Wrażliwość na drgania o niskiej częstotliwości, występujące w miękkich materiałach budowlanych, jest neutralizowana.\r\n\r\n\r\ncd 400-r\r\n\r\n \r\n\r\nCD 400-R detektor uderzeń - wstrząsowy z kontaktem magnetycznym, przeznaczony do montażu na różnego typu ramach i ościennicach okien i drzwi, zapewnia ich skuteczną podwójną ochronę. Sygnalizowane są wszelkie próby sforsowania obiektu za pomocą narzędzi stosowanych z użyciem dużej siły oraz nieautoryzowane otwarcie zabezpieczanych okien lub drzwi. Detektor wykrywa drgania o wysokiej amplitudzie i krótkim czasie trwania. Niezawodność działania zapewnia cyfrowe przetwarzanie zarejestrowanych zdarzeń za pomocą mikrokontrolera o zaawansowanym algorytmie obróbki sygnału. Dobrany algorytm zapewnia także wysoką odporność detektora na zakłócenia z otoczenia. Programowalny licznik zdarzeń pozwala ustalić ilość zdarzeń z przedziału od 1 do 4. Alarm zostanie wyzwolony po wystąpieniu zaprogramowanej ilości zdarzeń. Wykrycie eksplozji wyzwala alarm niezależnie od ilości zliczonych zdarzeń. Wymaganą czułość detektora CD 400-R można łatwo ustawić przy pomocy potencjometru. Poprzez wmontowany układ kontaktu magnetycznego detektor zabezpiecza też chronione okna lub drzwi niezależną pętlą alarmową przed ich nieautoryzowanym otwarciem.\r\nNapięcie zasilania		9-15 VDC\r\nPobór prądu w stanie czuwania		9 mA\r\nPobór prądu w stanie alarmu		10 mA\r\nWyjście alarmowe		Przekaźnik, NC\r\nDane wyjścia alarmowego		100 mA/100 V DC\r\nZabezpieczenie sabotażowe zdjęcia pokrywy		TAK\r\nDane styków przeł. antysabotażowego		50 mA/35 V DC\r\nWskazanie alarmu		Dioda LED\r\nPodłączanie		Przyłącza śrubowe\r\nTemperatura pracy		-10 do +70Â°C\r\nObudowa / kolor		Plastikowa ABS / biały\r\nKategoria ochronna obudowy		IP 42\r\nWymiary Detektora (L x W x H) mm		91 x 31 x 23\r\nWymiary Magnesu (L x W x H) mm		65 x 16 x 19\r\nOdległość zamknięcia kontaktu w mm		25\r\nAtesty		Zgodny z CE, GOST R Rosja \r\n', '99zł', '55be321fabbc9', 1),
