(138, 'Sejf Konsmetal Wrzutnia bębnowa Kasa pancerna ! Czujka sejsmiczna', 'SG 55/ll-E+WBX3 Konsmetal Klasa D-ll Waga 136kg Bardzo masywny i solidny . Idealny do bardzo szybkiego chowania gotówki i innych kosztowności ! Zamek szyfrowy elektroniczny! Wys.76.5cm x Szer.48 x Głęb.48 . Wrzutnia o szer. 22cm Cena ( mojego do negocjacji)nowego z tym wyposażenie ok.10 000zł \r\n\r\nCena: 7900 zł\r\n\r\n\r\nJest w stanie idealnym (bardzo mało używany i jest po przeglądzie , malowaniu   ).\r\n\r\nBył na wyposażeniu Banku.\r\n\r\nSolidne i grube ścianki :  w wykonaniu  dwu płaszczowym ( wewnątrz  zastosowano specjalny materiał ogniotrwały).\r\n\r\n \r\n\r\n\r\n\r\nDodatkowo  na dnie są otwory umożliwiające montaż do podłoża .\r\n \r\nSejf po produkcji otrzymał  klasę bezpieczeństwa , z certyfikatem IMP( jest tabliczka z wszelkimi danymi )!\r\n\r\nPokryty jest nie ,,rzucającą się w oczy,,  szarą farbą proszkową. Może być jako mebel,szafka w biurze , domu . Można przechowywać duże kwoty pieniędzy,kosztowności ale i dokumenty , nośniki danych , pamiątki, chemię ,farmaceutyki,  narzędzia ,komputer itp. \r\n\r\n\r\nMam jeszcze  inne sejfy np.wrzutowe , kasjerskie , multisejfy oraz małe sejfy i kasetki.\r\n\r\nWaga  ok. 150kg w związku z tym mile widziany odbiór osobisty, jednakże istnieje możliwość\r\nodpłatnej wysyłki ,, przy okazji,,, lub kurierem .\r\n\r\n    WYPRZEDAŻ .Takiej okazji nie będzie długo!\r\n\r\nNa działanie sejfu mogę odpłatnie udzielić  gwarancji', '', '55ef3a399cb93', 1),
