(140, 'Metalkas z wrzutnią,Kasjerski,Bankowy,TG XGBSWI- Klasa DI ! Bardzo Solidny!!', 'Cena i aukcja dotyczy sejfu. Wymiary: wys.70cm x szer.54 x gł.56 Bardzo mało używany, stan idealny, jak Nowy,  sprawny 100% !! Mogę udzielić rocznej gwarancji !! Uważam że cena jest niska ale nożna negocjować .2 Nowe specjalistyczne zamki Wittkopp i Lowe and Fletcher  , po 2 klucze Cena producenta to prawie 2000zł więcej!!!  Dziękuję i zapraszam', '2890', '55f137ec35677', 1),
