(143, 'Sejf TECHMARK Posejdon! Kasa pancerna! Bardzo solidny!!!', 'Sejfy gabinetowe POSEJDON posiadają I klasę odporności na włamanie. \r\nWymiary wys.70cm x szer.52 x gł.46 . Obudowę sejfu stanowi\r\npodwójny płaszcz blachy, malowanej proszkowo w kolorach wg palety RAL. Przestrzeń między płaszczyznami blachy wypełnia materiał ogniotrwały. Trójpłaszczowe drzwi sejfu z zawiasami wewnętrznymi, blokują 4 rygle o średnicy 25 mm każdy, wysuwane w trzech kierunkach.\r\nWyposażone są opcjonalnie w atestowane zamki odpowiednie do klasy sejfu (kluczowe, szyfrowe), półki .\r\n\r\nSejfy mogą być doposażone w:  - dodatkowe półki  ;  - zamek szyfrowy - elektroniczny.', '', '55f13a51c55c2', 1),
