(151, 'Sejf Kasjerski lub  Bankowy, Konsmetal Szuflada z wrzutnią', 'Sejf Konsmetal Typ SL 67+/S2-K z wrzutnią z Certyfikatem Instytutu Mechaniki Precyzyjnej.\r\n\r\nStan idealny,po przeglądzie i konserwacji ! 100% Sprawny . Bardzo mało używany! \r\n\r\nZdjęcie tabliczki może być z innego sejfu bo sprzedałem wcześniej i mam jeszcze dwa.\r\nWymiary wys. 67cm x szer.50cm x gł.55  Waga 113 Kg\r\nIdealny do Banku, handlu , punktu usługowego , domu. Posiada  2 atestowane zamki jedno kluczowe z pojedynczymi kluczami dwu piórowymi. Oryginalnie przystosowany do innych sejfowych zamków  ( i można zamocować dodatkowy 3 zamek ) oraz do instalacji alarmowej. \r\nOpis wrzutni:\r\nSejfy wrzutowe są droższe od zwykłych ponieważ konstrukcja jest  bardziej skomplikowana ( 2 odrębne komory ) i posiadają 2 zamki. Szuflada jest tak skonstruowana że przy zamknięciu , część rzeczy włożona do tylnej części szuflady, wypada z niej ( wlatuje ) do właściwego sejfu, ( do komory z której wyłowienie poprzez szufladę jest niemożliwe !) . Klucze są w różnych miejscach ( rękach) i łatwo mieć nadzór nad mieniem , czy to w domu czy w handlu .  Również w wypadku napadu jest to dużo lepsze rozwiązanie ( dobrze jest wywiesić info Klucze do Sejfu znajdują się ...np. poza lokalem). W szufladzie znajdują się nieznaczne wartości. Cena montażu 3 zamka zależy od  rodzaju zamka.\r\nhttp://allegro.pl/sejf-kasjerski-z-szuflada-ls-67-1-i5799151131.html - cena podobnego 3600zł \r\n', '1650', '55fc5bee2f72e', 1),
