(154, 'Piec C.O. na gaz drzewny Holzgas do 40 KW', 'Piec jest zrobiony przez firmę ( podobny do Vigas ) .Palić nim można ( nie tak jak wspomnianymi wcześniej- Super drewnem), Praktycznie wszystkim - o tym dowiesz się będąc osobiście- były robione doświadczenia ! Drewno powinno być suche można dorzucić trochę wilgotnego podobnie jak i inne materiały . Nie może być za dużo bardzo drobniutkiego materiału ( trociny, muł, flot, ) . Gdy się bardzo zmieni skład paliwa należy kontrolować spalanie.Można dorzucić : Każdy rodzaj węgla, torfu odpadów innych wszystko co się pali ! Musi być to wypraktykowane. A ma i również zbiornik wyrównawczy.Cena 2/3 ceny w hurtowni!!', '', '5607257490dcf', 1),
