(304, 'Szyszki-Nasiona Jodła Koreańska Hurt !!', 'Zebrane metodą kaskaderską :) , 03.10.2015. Ostatni moment na zbiór bo  same się sypały. , Pełne  wiadro chyba 15l? ( tynk akrylowy 25kg) Są to same szyszki bez słupków ( ogonków ) i śmieci! Waga 1600 gram', '', '5611698070478', 0),
(305, '195R14C DĘBICA QUARTET FRIGO  106-104P MS 4st. Kpl. z felgami do Transita NOWE!', '195R14C DĘBICA QUARTET FRIGO  106/104P M+S\r\nDębica 195/14c 106/104p \r\nSzerokość opony: 195\r\nPrędkość: P do 150 km/h \r\nskoro nowe  to 250-300zł to moje 190x4=760zł z felgami wyczyszczone , pomalowane i wyważone. oraz 2 szt używane po 130zł', '', '5614097d98555', 0),
(306, 'Nowa tarcza  sprzęgła Fiat 125p Polonez?', 'Śr. tarczy 215 mm . 20 zębów . Kpl. w hurtowni 200zł to 110 moja cena', '', '56140d725e020', 0);
INSERT INTO `products` (`id`, `title`, `description`, `price`, `images_ref`, `hidden`) VALUES
(307, 'Przetwornik BA674D temperatury zasilany z pętli 4-20mA z wyświetlaczem o wielkości cyfry 20 mm z bargrafem', '	Przetwornik temperatury BA674D z dużym wyświetlaczem wartości w strefach zagrożonych wybuchem. Urządzenie uniwersalne do podłączenia czujników RTD, TC, i wyjściem analogowym HART. Wyraźny wyświetlacz z bargrafem i podświetleniem przyjazny dla obsługi. Solidna obudowa gwarantuje bezawaryjną prace na obiekcie. http://www.trautomatyka.pl/BA674D,r,264,954\r\nhttp://beka.stockshed.com/index.php?route=product/product&product_id=2058\r\nPrice: ?484.80 \r\nDane techniczne\r\nwersja\r\n	polowa\r\nTemperatura pracy\r\n	-40... +70 °C\r\nDokładność\r\n	wejście RTD: ±0.1?C\r\nwejście TC: ±10µV\r\nIlość zmiennych\r\n	1\r\nWyświetlacz\r\n	5 znaków o wysokości 20 mm + bargraf o rozdzielczości 31 punktów\r\nSygnał wejściowy\r\n	-rezystancyjny czujnik temperatury (Pt100, Pt1000)\r\n-Termopara (typu B, E, J, K, N, R, S, T)\r\n-wejście rezystancyjne\r\n-wejście napięciowe\r\nZasilanie\r\n	zasilanie z pętli bez podświetlenia (min. 9 V) lub (min. 15,5 V) w przypadku użycia funkcji „backlight” o pełnej mocy\r\nFunkcje standardowe\r\n	-diagnostyka urządzenia i czujnika\r\n-kompensacja zimnych styków\r\n-wyświetlanie alarmów\r\n–możliwość ustawienia pozycji przecinków\r\n-blokada hasłem\r\n-pełna kalibracja przyciskami lub za pośrednictwem komunikacji HART\r\nOpcjonalnie\r\n	-przyciski zewnętrzne\r\n-podświetlenie „backlight” zasilane z pętli\r\n-2 x sygnał binarny alarmowy\r\n-wymienialne etykiety\r\nWykonanie materiałowe\r\n	obudowa z tworzywa GRP\r\nKlasa ochrony\r\n	IP66', '999', '564b9d1194128', 0),
(308, 'HP Pavilion zd7000 z Kablami i zasilaczem Oryginał!', 'Laptop był sprawny do ostatniej chwili ( używało dziecko) ,ale obraz wyświetla się na innym monitorze ( na ekranie są pasy) - coś uszkodzone , dlatego sprzedaję = do naprawy! Lub na części !  Nie znam parametrów!! Nie znam pojemności dysku. Bateria bardzo słaba ( Koszt nowej 79zł ) Wiem że głos miał bardzo mocny.  Ma jakieś specjalistyczne oryginalne kable, zasilacz . Mogę do niego sprzedać monitor za 90zł Jest porysowany ale czysty, wcześniej używała przyjaciółka z UK, nie mam pudełka . Dużo czasu przeleżał , cena do negocjacji. Zdjęcia kabli może mi się uda zrobić Nie ma możliwości zwrotu z powodu wyjazdu. ', '299', '564c5b96885a0', 0),
(309, 'Wkrętarka', '6V', '', '564c5d8bdda0d', 0),
(310, 'Wełna szklana 650cm dł.120cm szer. 15cm gr.', '7.8m2 w rolce a jest kilkadziesiąt rolek 7.8m2 w rolce a jest kilkadziesiąt rolek  przykurzone 20% taniej niż u dystrybutora jeśli całość Wystarczy na 2 małe dachy. 10% taniej jak min. 15 rolek.  Możliwość dowozu po kosztach. ', '', '564ded09ed926', 0),
(311, 'Staroć nieznana KLOSZ LAMPY Motosprzęt Poznań', '', '', '564df80a1ee9b', 0),
(312, 'Młot wyburzeniowy do naprawy', 'Wyłącznik uszkodzony- zacięty? i trochę kabla do obcięcia', '65zł', '564e216bbbd39', 0),
(313, 'Duża Pilarka RT-SM 305 L Einhel Stołowa', 'Bardzo  solidny sprzęt o Wielofunkcyjnym zastosowaniu. 1800W 4800/min. Ułamana noga , ogranicznik głębokości cięcia i mocowanie stołu obrotowego, wszystko inne w super stanie.Do niej może być tarcza ? 210 x ? 30 x 2.8 mm Sprzedaje bez pudła i to co widać na zdjęciu,bez tarczy, może i nawet mam jakąś  ale za dużo towaru i nie znajdę szybko. Cena tylko 479zł!! W sklepach cena  ok.3 x większa !! Majsterkowicz ze sprzętem jest w stanie za darmo  to naprawić ! Pilarka jest b. duża i ciężka , ok.15.5 kg. Uszkodzenia są wynikłe ze złego zapakowania , do przesłania należało położyć na dno bardzo sztywne kartony a ścianki i góra paczki powinna być  sztywna i wewnątrz materiał wypełniający,objętość by nic nie goniło itd. , ( kurierzy absolutnie  nie dbają o paczkę ). Więcej nic nie jest uszkodzone (nie wiem dlaczego na zdjęciach niestety nie ma pęknięcia mocowania stołu obrotowego , ale jest to tak samo jak noga- do pospawania - TIG AC do Aluminium . Nie kleiłbym tego (Poxipol itp. ) , choć są  tam małe siły . Spawacz musi mieć doświadczenie .', '369', '564e2cffaa338', 0),
(314, 'kOŁPAKI Na koła 13 i 14', '125p , Opel Omega A, ', '', '5651e79c120a4', 0),
(316, '4 szt. Nowych opon 195R14C DĘBICA QUARTET FRIGO z felgam do Transita', 'Okazyjnie sprzedam Kpl. 4 szt. Nowych opon 195R14C DĘBICA QUARTET FRIGO 106/104P M+S z felgami do Transita NOWE! Tylko 799zł !!\r\nOraz inne 2szt zimowe średnio zużyte również z felgami po 85zł szt.\r\nKilka innych opon po kilkanaście złotych.', '799', '56978b2134c44', 0),
(315, 'Bateria Akumulator Apple A1280 MacBook Pro  Oryginał', 'Bateria używana sprawna , nie wiem w jakim stopniu bo nie mam już laptopa i ładowarki. Podaje napięcie i prąd . Li-Ion Polymer polimerowa ,  litowo-jonowa ma tzw. efekt pamięci, polimerowa - nie ma go. Oryginał więc na pewno będzie pasowała . Parametry 10.8V - 45Wh .Cena nowego ok. 400zł , nie można zwrócić,ponieważ wyjeżdżam na b.długo,ew. przy odbiorze osobistym można testować. Cena u mnie do negocjacji-podaj rozsądną. Dziękuję', '', '5652d1d9ad11f', 0),
(317, 'Pilarka ukośnica nowa evolution', 'Nowe nieużywane ,cena za 1 szt.\r\n-http://www.evolutionpowertools.com/uk/project/fury3b.php\r\n-http://www.evolutionpowertools.com/videos/fury3-b_video.html\r\n-http://www.evolutionpowertools.com/uk/multipurpose/', '450zł', '56b0dbd145cc3', 0),
(318, '2 piece akumulacyjne -prawie wyremontowane ( teraz w częściach ).', 'Mam 2 piece akumulacyjne -prawie wyremontowane ( teraz w częściach ). ', '', '56f07f44ddb34', 0);
